import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Question({question})
{
    const answerList = question.answerList;
    return(
        <tr>
            <td>question.quesNo</td>
            <td>
                <label>question.questionText</label>
                <table className='table table-primary w-100'>
                    <tbody>
                        {answerList.map((element, index)=>{<Answer key = {index} quesType = {question.quesType} quesNo = {question.quesNo} ansNo = {element.ansNo} ansText = {element.ansText}/>})}
                    </tbody>
                </table>
            </td>
        </tr>
    );
}

export default Question;
